import { useMemo } from "react";
import { Form, Input } from "antd";

const NicknameEditForm = () => {
  const style = useMemo(() => ({
    marginBottom: "20px",
    border: "1px solid black",
    padding: "20px",
  }));

  return (
    <Form>
      <Input.Search addonBefore="닉네임" enterButton="수정" />
    </Form>
  );
};

export default NicknameEditForm;
